import React from "react";
import { Carousel, Image } from "react-bootstrap/";
import "bootstrap/dist/css/bootstrap.min.css";

function CommonBurgermini() {
  return (
    <React.Fragment>
      <div class="carousel-item active" style={{ height: "150px" }}>
        <img src="/image/1.jpg" style={{ width: "100%", height: "150px" }} />
      </div>
      <div class="carousel-item" style={{ height: "150px" }}>
        <img src="/image/2.jpg" style={{ width: "100%", height: "150px" }} />
      </div>
    </React.Fragment>
  );
}

function CommonBurger() {
  return (
    <div className="carousel slide" data-ride="carousel">
      <ol class="carousel-indicators">
        <li
          data-target="#carouselExampleIndicators"
          data-slide-to="0"
          class="active"
        ></li>
        <li data-target="#carouselExampleIndicators" data-slide-to="1"></li>
      </ol>
      <div class="carousel-inner">
        <CommonBurgermini />
      </div>
    </div>
  );
}

export default CommonBurger;
